    false,nt"url": null,nt"notes": "This annual narrative report for North
    Platte National Wildlife Refuge outlines Refuge accomplishments during the 1982
    calendar year. The report begins by describing the climate and habitat conditions
    in the Refuge, as well as the land acquisition program and system status. The construction
    and maintenance section describes physical developments and maintenance. The habitat
    management section discusses grasslands, wetlands, forests, grazing, and water rights.
    Wildlife- including endangered and threatened species, migratory birds, raptors,
    and fishery resources- are discussed. Photographs are attached.",nt"license_title":
